import React from "react";
import "./project.css";
// import Projectone from "../../Images/profile.JPG"

const Projects = () => {

    return (
        <div className="main-content-area-box">
            <h2 className="headline">Projects</h2>
            <div class="featured__StyledProject-sc-19vdtah-9 VhaEB"
                data-sr-id="4">
                <div class="featured__StyledContent-sc-19vdtah-1 gWlhZI"><h4 class="featured__StyledLabel-sc-19vdtah-2 dZTpBf">Featured Project</h4><h5 class="featured__StyledProjectName-sc-19vdtah-3 jRnWTV"><a href="https://www.youtube.com/watch?v=AAkNyZlUae0" target="_blank" rel="nofollow noopener noreferrer" aria-label="External Link">Face Mask Detection</a></h5>
                    <div class="featured__StyledDescription-sc-19vdtah-4 hwxmov">
                        <p>Face Mask Detection system to detect face masks in static
                            images as well as in real-time video streams. Own
                            custom dataset was built using Bing Search API and
                            Kaggle.</p>
                        <p>Inspired by Adrian Rosebrock's <a href="www.gothub.com" target="_blank" rel="nofollow noopener noreferrer">PyImageSearch Blog</a>
                        </p>
                    </div>
                    <div class="featured__StyledLinkWrapper-sc-19vdtah-6 gDgIRh">
                    </div>
                    <a href="https://www.youtube.com/watch?v=AAkNyZlUae0" target="_blank" rel="nofollow noopener noreferrer" class="featured__StyledImgContainer-sc-19vdtah-8 krVnlu">
                    <div class="featured__StyledFeaturedImg-sc-19vdtah-7 kuGvoQ gatsby-image-wrapper"><div aria-hidden="true" style="width: 100%; padding-bottom: 65.7143%;"></div>
                   </div></a>
                    </div>
                    </div>
                </div>
                );
}

                export default Projects;
